import Header from "./Header";
import Head from "next/head";

const layoutStyle = {
  margin: 20
};

const Layout = props => {
  console.log(props);
  return (
    <>
      <Head>
        <title>Ryan Grunest</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>
      <div style={layoutStyle}>
        <Header />
        {props.children}
      </div>
    </>
  );
};

export default Layout;
